import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import { SliderWrapper, Imgage } from './homepage.styles';

import HouseboatBlue from 'assets/houseboatBlue.jpeg';
import HouseboatGang from 'assets/houseboatGang.jpeg';

const HomePage = () => {
	const settings = {
		dots: true,
		infinite: true,
		slidesToShow: 1,
		slidesToScroll: 1,
		autoplay: false,
		speed: 1000,
		autoplaySpeed: 4000,
		cssEase: 'linear',
		arrows: false,
		pauseOnHover: true,
	};
	return (
		<div className="main">
			<SliderWrapper>
				<Slider {...settings}>
					<div>
						<div>
							<Imgage imageSrc={HouseboatBlue} />
						</div>
					</div>
					<div>
						<Imgage imageSrc={HouseboatGang} />
					</div>
				</Slider>
			</SliderWrapper>
		</div>
	);
};

export default HomePage;
